class Seat{
    constructor(number, name, isOccupied)
    {
        this.number = number;
        this.name = name;
        this.isOccupied = isOccupied;
    }

    occupy(name)
    {
        this.name = name;
        this.isOccupied = true;
    }

    free()
    {
        this.name = "";
        this.isOccupied = false;
    }
}

export default Seat;
